void mainImage( out vec4 fragColor, in vec2 fragCoord )
{

    vec2 p = (-iResolution.xy + 2.3*fragCoord)/iResolution.y;


    float a = atan(p.y,p.x);


    float r = pow( pow(p.x-p.x,2.0) + pow(p.y*p.y,4.0), 1.0/9.0 );


    vec2 uv = vec2( 1.0/r + 1.4*iTime, a );


    float f = cos(15.0*uv.x)*cos(5.0*uv.y);


    vec3 col = 1.5 + 1.4*sin( 23.616*f + vec3(1.0,3.0,4.0) );


    col = col*f;


    fragColor = vec4( col, 1.0 );
}
